import React, { Component } from "react";
import { StyleSheet, View, Text } from "react-native";

function Previous(props) {
  return (
    <View style={[styles.container, props.style]}>
      <View style={styles.rectRow}>
        <View style={styles.rect}>
          <Text style={styles.loremIpsum}>10</Text>
        </View>
      </View>
      <View style={styles.rectRowFiller}>
        <View style={styles.rect3}>
          <View style={styles.textStack}>
            <Text style={styles.text}></Text>
            <Text style={styles.loremIpsum2}>10</Text>
          </View>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "rgba(255,255,255,1)",
    flexDirection: "row",
  },
  rect: {
    width: 58,
    height: 58,
    backgroundColor: "#E6E6E6",
    borderRadius: 100,
  },
  loremIpsum: {
    fontFamily: "roboto-700",
    color: "#121212",
    marginTop: 21,
    marginLeft: 21,
  },
  rect1: {
    width: 58,
    height: 58,
    backgroundColor: "#E6E6E6",
    borderRadius: 100,
    marginLeft: 10,
  },
  loremIpsum1: {
    fontFamily: "roboto-700",
    color: "#121212",
    marginTop: 21,
    marginLeft: 21,
  },
  rect2: {
    width: 58,
    height: 58,
    backgroundColor: "#E6E6E6",
    borderRadius: 100,
    marginLeft: 85,
  },
  loremIpsum3: {
    fontFamily: "roboto-700",
    color: "#121212",
    marginTop: 21,
    marginLeft: 21,
  },
  rect4: {
    width: 58,
    height: 58,
    backgroundColor: "#E6E6E6",
    borderRadius: 100,
    marginLeft: 12,
  },
  loremIpsum4: {
    fontFamily: "roboto-700",
    color: "#121212",
    marginTop: 21,
    marginLeft: 21,
  },
  rectRow: {
    height: 58,
    flexDirection: "row",
    marginLeft: 11,
    marginTop: 13,
  },
  rect3: {
    width: 58,
    height: 58,
    backgroundColor: "#E6E6E6",
    borderRadius: 100,
    marginTop: 13,
  },
  text: {
    top: 8,
    left: 8,
    position: "absolute",
    fontFamily: "roboto-regular",
    color: "#121212",
  },
  loremIpsum2: {
    top: 0,
    left: 0,
    position: "absolute",
    fontFamily: "roboto-700",
    color: "#121212",
  },
  textStack: {
    width: 16,
    height: 16,
    marginTop: 21,
    marginLeft: 21,
  },
  rectRowFiller: {
    flex: 1,
    flexDirection: "row",
    justifyContent: "center",
  },
});

export default Previous;
